import React from "react";
import FormRegistrasi from "./FormRegister";

const RegisterComponent = (props) => {
  return (
    <section className="registrasi">
      <div className="logoInLogin">
        <img
          style={{ width: "170px" }}
          src={require("../media/logotoped.svg")}
        />
      </div>
      <div className="row">
        <div className="col-lg-6">
          <img
            className="gambarRegistrasi"
            src={require("../media/../media/backgroundregis.png")}
          />
          <h3>Jual Beli Mudah Hanya di Tokopedia</h3>
          <p>Gabung dan rasakan kemudahan bertransaksi di Tokopedia</p>
        </div>
        <div className="col-lg-6">
          <FormRegistrasi />
        </div>
      </div>
    </section>
  );
};
export default RegisterComponent;
